tutorial_business-automation_1	{"id": "business-automation", "tasks": [{"id": "working_directory", "type": "io.kestra.plugin.core.flow.WorkingDirectory", "tasks": [{"id": "query", "sql": "CREATE TABLE IF NOT EXISTS features (\\n    id INTEGER PRIMARY KEY,\\n    name TEXT NOT NULL,\\n    description TEXT NOT NULL,\\n    release_version TEXT NOT NULL,\\n    edition TEXT NOT NULL\\n);\\n\\nDELETE FROM features;\\n\\nINSERT INTO features (name, description, release_version, edition)\\nVALUES \\n    ('Worker Groups', 'Allows targeting specific tasks or triggers to run on specific remote workers for better scalability and resource management.', '0.10', 'Enterprise'),\\n    ('Realtime Triggers', 'Supports triggering event-driven workflows in real-time.', '0.17', 'Open-Source'),\\n    ('Task Runners', 'Provides on-demand remote execution environments for running tasks.', '0.16', 'Open-Source'),\\n    ('KV Store', 'Adds key-value storage for persisting data across workflow executions.', '0.18', 'Open-Source'),\\n    ('SCIM Directory Sync', 'Allows synchronization of users and groups from Identity Providers.', '0.18', 'Enterprise');  \\n    \\nSELECT * FROM features\\nORDER BY release_version;\\n", "url": "jdbc:sqlite:kestra.db", "type": "io.kestra.plugin.jdbc.sqlite.Queries", "fetchType": "STORE"}, {"id": "to_csv", "from": "{{ outputs.query.outputs[0].uri }}", "type": "io.kestra.plugin.serdes.csv.IonToCsv"}, {"id": "to_excel", "from": "{{ outputs.query.outputs[0].uri }}", "type": "io.kestra.plugin.serdes.excel.IonToExcel"}]}], "deleted": false, "disabled": false, "revision": 1, "namespace": "tutorial", "description": "Business Automation"}	id: business-automation\nnamespace: tutorial\ndescription: Business Automation\n\ntasks:\n  - id: working_directory\n    type: io.kestra.plugin.core.flow.WorkingDirectory\n    tasks:\n      - id: query\n        type: io.kestra.plugin.jdbc.sqlite.Queries\n        url: jdbc:sqlite:kestra.db\n        fetchType: STORE\n        sql: |\n          CREATE TABLE IF NOT EXISTS features (\n              id INTEGER PRIMARY KEY,\n              name TEXT NOT NULL,\n              description TEXT NOT NULL,\n              release_version TEXT NOT NULL,\n              edition TEXT NOT NULL\n          );\n\n          DELETE FROM features;\n\n          INSERT INTO features (name, description, release_version, edition)\n          VALUES \n              ('Worker Groups', 'Allows targeting specific tasks or triggers to run on specific remote workers for better scalability and resource management.', '0.10', 'Enterprise'),\n              ('Realtime Triggers', 'Supports triggering event-driven workflows in real-time.', '0.17', 'Open-Source'),\n              ('Task Runners', 'Provides on-demand remote execution environments for running tasks.', '0.16', 'Open-Source'),\n              ('KV Store', 'Adds key-value storage for persisting data across workflow executions.', '0.18', 'Open-Source'),\n              ('SCIM Directory Sync', 'Allows synchronization of users and groups from Identity Providers.', '0.18', 'Enterprise');  \n              \n          SELECT * FROM features\n          ORDER BY release_version;\n\n      - id: to_csv\n        type: io.kestra.plugin.serdes.csv.IonToCsv\n        from: "{{ outputs.query.outputs[0].uri }}"\n\n      - id: to_excel\n        type: io.kestra.plugin.serdes.excel.IonToExcel\n        from: "{{ outputs.query.outputs[0].uri }}"\n
tutorial_business-processes_1	{"id": "business-processes", "tasks": [{"id": "send_approval_request", "url": "{{ inputs.slack_webhook_uri }}", "type": "io.kestra.plugin.notifications.slack.SlackIncomingWebhook", "payload": "{\\n  \\"channel\\": \\"#vacation\\",\\n  \\"text\\": \\"Validate holiday request for {{ inputs.request.name }}. To approve the request, click on the `Resume` button here http://localhost:8080/ui/executions/{{flow.namespace}}/{{flow.id}}/{{execution.id}}\\"\\n}\\n"}, {"id": "wait_for_approval", "type": "io.kestra.plugin.core.flow.Pause"}, {"id": "process_request", "uri": "https://kestra.io/api/mock", "body": "{{ inputs.request }}", "type": "io.kestra.plugin.core.http.Request", "method": "POST", "options": {"allowFailed": "false", "defaultCharset": "UTF-8", "followRedirects": "true"}}], "inputs": [{"id": "request.name", "type": "STRING", "defaults": "Rick Astley", "required": true}, {"id": "request.start_date", "type": "DATE", "defaults": "2024-07-01", "required": true}, {"id": "request.end_date", "type": "DATE", "defaults": "2024-07-07", "required": true}, {"id": "slack_webhook_uri", "type": "URI", "defaults": "https://kestra.io/api/mock", "required": true}], "deleted": false, "disabled": false, "revision": 1, "namespace": "tutorial", "description": "Business Processes"}	id: business-processes\nnamespace: tutorial\ndescription: Business Processes\n\ninputs:\n  - id: request.name\n    type: STRING\n    defaults: Rick Astley\n\n  - id: request.start_date\n    type: DATE\n    defaults: 2024-07-01\n\n  - id: request.end_date\n    type: DATE\n    defaults: 2024-07-07\n\n  - id: slack_webhook_uri\n    type: URI\n    defaults: https://kestra.io/api/mock\n\ntasks:\n  - id: send_approval_request\n    type: io.kestra.plugin.notifications.slack.SlackIncomingWebhook\n    url: "{{ inputs.slack_webhook_uri }}"\n    payload: |\n      {\n        "channel": "#vacation",\n        "text": "Validate holiday request for {{ inputs.request.name }}. To approve the request, click on the `Resume` button here http://localhost:8080/ui/executions/{{flow.namespace}}/{{flow.id}}/{{execution.id}}"\n      }\n\n  - id: wait_for_approval\n    type: io.kestra.plugin.core.flow.Pause\n\n  - id: process_request\n    type: io.kestra.plugin.core.http.Request\n    uri: https://kestra.io/api/mock\n    method: POST\n    contentType: application/json\n    body: "{{ inputs.request }}"\n
tutorial_data-engineering-pipeline_1	{"id": "data-engineering-pipeline", "tasks": [{"id": "extract", "uri": "https://dummyjson.com/products", "type": "io.kestra.plugin.core.http.Download", "options": {"allowFailed": "false", "defaultCharset": "UTF-8", "followRedirects": "true"}}, {"id": "transform", "type": "io.kestra.plugin.scripts.python.Script", "script": "import json\\nimport os\\n\\nwith open(\\"data.json\\", \\"r\\") as file:\\n    data = json.load(file)\\n\\nfiltered_data = [\\n    {column: product.get(column, \\"N/A\\") for column in {{ inputs.columns_to_keep }}}\\n    for product in data[\\"products\\"]\\n]\\n\\nwith open(\\"products.json\\", \\"w\\") as file:\\n    json.dump(filtered_data, file, indent=4)\\n", "inputFiles": {"data.json": "{{ outputs.extract.uri }}"}, "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "outputFiles": "[\\"*.json\\"]", "containerImage": "python:3.11-alpine"}, {"id": "query", "sql": "INSTALL json;\\nLOAD json;\\nSELECT brand, round(avg(price), 2) as avg_price\\nFROM read_json_auto('{{ workingDir }}/products.json')\\nGROUP BY brand\\nORDER BY avg_price DESC;\\n", "type": "io.kestra.plugin.jdbc.duckdb.Query", "fetchType": "STORE", "inputFiles": {"products.json": "{{ outputs.transform.outputFiles['products.json'] }}"}}], "inputs": [{"id": "columns_to_keep", "type": "ARRAY", "defaults": ["brand", "price"], "itemType": "STRING", "required": true}], "deleted": false, "disabled": false, "revision": 1, "namespace": "tutorial", "description": "Data Engineering Pipelines"}	id: data-engineering-pipeline\nnamespace: tutorial\ndescription: Data Engineering Pipelines\n\ninputs:\n  - id: columns_to_keep\n    type: ARRAY\n    itemType: STRING\n    defaults:\n      - brand\n      - price\n\ntasks:\n  - id: extract\n    type: io.kestra.plugin.core.http.Download\n    uri: https://dummyjson.com/products\n\n  - id: transform\n    type: io.kestra.plugin.scripts.python.Script\n    containerImage: python:3.11-alpine\n    inputFiles:\n      data.json: "{{ outputs.extract.uri }}"\n    outputFiles:\n      - "*.json"\n    script: |\n      import json\n      import os\n\n      with open("data.json", "r") as file:\n          data = json.load(file)\n\n      filtered_data = [\n          {column: product.get(column, "N/A") for column in {{ inputs.columns_to_keep }}}\n          for product in data["products"]\n      ]\n\n      with open("products.json", "w") as file:\n          json.dump(filtered_data, file, indent=4)\n\n  - id: query\n    type: io.kestra.plugin.jdbc.duckdb.Query\n    inputFiles:\n      products.json: "{{ outputs.transform.outputFiles['products.json'] }}"\n    sql: |\n      INSTALL json;\n      LOAD json;\n      SELECT brand, round(avg(price), 2) as avg_price\n      FROM read_json_auto('{{ workingDir }}/products.json')\n      GROUP BY brand\n      ORDER BY avg_price DESC;\n    fetchType: STORE\n
tutorial_dwh-and-analytics_1	{"id": "dwh-and-analytics", "tasks": [{"id": "dbt", "type": "io.kestra.plugin.core.flow.WorkingDirectory", "tasks": [{"id": "clone_repository", "url": "https://github.com/kestra-io/dbt-demo", "type": "io.kestra.plugin.git.Clone", "branch": "main"}, {"id": "dbt_build", "type": "io.kestra.plugin.dbt.cli.DbtCLI", "commands": "[\\"dbt deps\\",\\"dbt build\\"]", "profiles": "jaffle_shop:\\n  outputs:\\n    dev:\\n      type: duckdb\\n      path: dbt.duckdb\\n      extensions: \\n        - parquet\\n      fixed_retries: 1\\n      threads: 16\\n      timeout_seconds: 300\\n  target: dev      \\n", "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "containerImage": "ghcr.io/kestra-io/dbt-duckdb:latest"}, {"id": "python", "type": "io.kestra.plugin.scripts.python.Script", "script": "import duckdb\\nimport pandas as pd\\n\\nconn = duckdb.connect(database='dbt.duckdb', read_only=False)\\n\\ntables_query = \\"SELECT table_name FROM information_schema.tables WHERE table_schema = 'main';\\"\\n\\ntables = conn.execute(tables_query).fetchall()\\n\\n# Export each table to CSV, excluding tables that start with 'raw' or\\n'stg'\\n\\nfor table_name in tables:\\n    table_name = table_name[0]\\n    # Skip tables with names starting with 'raw' or 'stg'\\n    if not table_name.startswith('raw') and not table_name.startswith('stg'):\\n        query = f\\"SELECT * FROM {table_name}\\"\\n        df = conn.execute(query).fetchdf()\\n        df.to_csv(f\\"{table_name}.csv\\", index=False)\\n\\nconn.close()\\n", "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "outputFiles": "[\\"*.csv\\"]", "containerImage": "ghcr.io/kestra-io/duckdb:latest"}]}], "deleted": false, "disabled": false, "revision": 1, "namespace": "tutorial", "description": "Data Warehouse and Analytics"}	id: dwh-and-analytics\nnamespace: tutorial\ndescription: Data Warehouse and Analytics\n\ntasks:\n  - id: dbt\n    type: io.kestra.plugin.core.flow.WorkingDirectory\n    tasks:\n      - id: clone_repository\n        type: io.kestra.plugin.git.Clone\n        url: https://github.com/kestra-io/dbt-demo\n        branch: main\n\n      - id: dbt_build\n        type: io.kestra.plugin.dbt.cli.DbtCLI\n        taskRunner:\n          type: io.kestra.plugin.scripts.runner.docker.Docker\n        containerImage: ghcr.io/kestra-io/dbt-duckdb:latest\n        commands:\n          - dbt deps\n          - dbt build\n        profiles: |\n          jaffle_shop:\n            outputs:\n              dev:\n                type: duckdb\n                path: dbt.duckdb\n                extensions: \n                  - parquet\n                fixed_retries: 1\n                threads: 16\n                timeout_seconds: 300\n            target: dev      \n\n      - id: python\n        type: io.kestra.plugin.scripts.python.Script\n        outputFiles:\n          - "*.csv"\n        taskRunner:\n          type: io.kestra.plugin.scripts.runner.docker.Docker\n        containerImage: ghcr.io/kestra-io/duckdb:latest\n        script: |\n          import duckdb\n          import pandas as pd\n\n          conn = duckdb.connect(database='dbt.duckdb', read_only=False)\n\n          tables_query = "SELECT table_name FROM information_schema.tables WHERE table_schema = 'main';"\n\n          tables = conn.execute(tables_query).fetchall()\n\n          # Export each table to CSV, excluding tables that start with 'raw' or\n          'stg'\n\n          for table_name in tables:\n              table_name = table_name[0]\n              # Skip tables with names starting with 'raw' or 'stg'\n              if not table_name.startswith('raw') and not table_name.startswith('stg'):\n                  query = f"SELECT * FROM {table_name}"\n                  df = conn.execute(query).fetchdf()\n                  df.to_csv(f"{table_name}.csv", index=False)\n\n          conn.close()\n
