tutorial_infrastructure-automation_1	{"id": "infrastructure-automation", "tasks": [{"id": "build_image", "tags": "[\\"{{ inputs.docker_image }}\\"]", "type": "io.kestra.plugin.docker.Build", "dockerfile": "FROM python:3.11-alpine\\nRUN pip install --no-cache-dir kestra\\n", "credentials": {"password": "{{ kv('DOCKERHUB_PASSWORD', errorOnMissing=false) }}", "registry": "https://index.docker.io/v1/", "username": "{{ kv('DOCKERHUB_USERNAME', errorOnMissing=false) }}"}}, {"id": "run_container", "type": "io.kestra.plugin.docker.Run", "commands": "[\\"pip\\",\\"show\\",\\"kestra\\"]", "pullPolicy": "NEVER", "containerImage": "{{ inputs.docker_image }}"}, {"id": "run_terraform", "type": "io.kestra.plugin.terraform.cli.TerraformCLI", "commands": "[\\"terraform plan 2>&1 | tee plan_output.txt\\",\\"terraform apply -auto-approve 2>&1 | tee apply_output.txt\\"]", "inputFiles": {"main.tf": "terraform {\\n  required_providers {\\n    http = {\\n      source = \\"hashicorp/http\\"\\n    }\\n    local = {\\n      source = \\"hashicorp/local\\"\\n    }\\n  }\\n}\\n\\nprovider \\"http\\" {}\\nprovider \\"local\\" {}\\n\\nvariable \\"pokemon_names\\" {\\n  type    = list(string)\\n  default = [\\"pikachu\\", \\"psyduck\\", \\"charmander\\", \\"bulbasaur\\"]\\n}\\n\\ndata \\"http\\" \\"pokemon\\" {\\n  count = length(var.pokemon_names)\\n  url   = \\"https://pokeapi.co/api/v2/pokemon/${var.pokemon_names[count.index]}\\"\\n}\\n\\nlocals {\\n  pokemon_details = [for i in range(length(var.pokemon_names)) : {\\n    name  = jsondecode(data.http.pokemon[i].response_body)[\\"name\\"]\\n    types = join(\\", \\", [for type in jsondecode(data.http.pokemon[i].response_body)[\\"types\\"] : type[\\"type\\"][\\"name\\"]])\\n  }]\\n\\n  file_content = join(\\"\\\\n\\\\n\\", [for detail in local.pokemon_details : \\"Name: ${detail.name}\\\\nTypes: ${detail.types}\\"])\\n}\\n\\nresource \\"local_file\\" \\"pokemon_details_file\\" {\\n  filename = \\"${path.module}/pokemon.txt\\"\\n  content  = local.file_content\\n}\\n\\noutput \\"file_path\\" {\\n  value = local_file.pokemon_details_file.filename\\n}\\n"}, "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "outputFiles": "[\\"*.txt\\"]", "beforeCommands": "[\\"terraform init\\"]"}, {"id": "log_pokemon", "type": "io.kestra.plugin.core.log.Log", "message": "{{ read(outputs.run_terraform.outputFiles['pokemon.txt']) }}"}], "inputs": [{"id": "docker_image", "type": "STRING", "defaults": "kestra/myimage:latest", "required": true}], "deleted": false, "disabled": false, "revision": 1, "namespace": "tutorial", "description": "Infrastructure Automation"}	id: infrastructure-automation\nnamespace: tutorial\ndescription: Infrastructure Automation\n\ninputs:\n  - id: docker_image\n    type: STRING\n    defaults: kestra/myimage:latest\n\ntasks:\n  - id: build_image\n    type: io.kestra.plugin.docker.Build\n    dockerfile: |\n      FROM python:3.11-alpine\n      RUN pip install --no-cache-dir kestra\n    tags:\n      - "{{ inputs.docker_image }}"\n    push: false # you can change this to true after adding credentials\n    credentials:\n      registry: https://index.docker.io/v1/\n      username: "{{ kv('DOCKERHUB_USERNAME', errorOnMissing=false) }}"\n      password: "{{ kv('DOCKERHUB_PASSWORD', errorOnMissing=false) }}"\n\n  - id: run_container\n    type: io.kestra.plugin.docker.Run\n    pullPolicy: NEVER # to use the local image we've just built\n    containerImage: "{{ inputs.docker_image }}"\n    commands:\n      - pip\n      - show\n      - kestra\n\n  - id: run_terraform\n    type: io.kestra.plugin.terraform.cli.TerraformCLI\n    beforeCommands:\n      - terraform init\n    commands:\n      - terraform plan 2>&1 | tee plan_output.txt\n      - terraform apply -auto-approve 2>&1 | tee apply_output.txt\n    outputFiles:\n      - "*.txt"\n    inputFiles:\n      main.tf: |\n        terraform {\n          required_providers {\n            http = {\n              source = "hashicorp/http"\n            }\n            local = {\n              source = "hashicorp/local"\n            }\n          }\n        }\n\n        provider "http" {}\n        provider "local" {}\n\n        variable "pokemon_names" {\n          type    = list(string)\n          default = ["pikachu", "psyduck", "charmander", "bulbasaur"]\n        }\n\n        data "http" "pokemon" {\n          count = length(var.pokemon_names)\n          url   = "https://pokeapi.co/api/v2/pokemon/${var.pokemon_names[count.index]}"\n        }\n\n        locals {\n          pokemon_details = [for i in range(length(var.pokemon_names)) : {\n            name  = jsondecode(data.http.pokemon[i].response_body)["name"]\n            types = join(", ", [for type in jsondecode(data.http.pokemon[i].response_body)["types"] : type["type"]["name"]])\n          }]\n\n          file_content = join("\\n\\n", [for detail in local.pokemon_details : "Name: ${detail.name}\\nTypes: ${detail.types}"])\n        }\n\n        resource "local_file" "pokemon_details_file" {\n          filename = "${path.module}/pokemon.txt"\n          content  = local.file_content\n        }\n\n        output "file_path" {\n          value = local_file.pokemon_details_file.filename\n        }\n\n  - id: log_pokemon\n    type: io.kestra.plugin.core.log.Log\n    message: "{{ read(outputs.run_terraform.outputFiles['pokemon.txt']) }}"\n
tutorial_microservices-and-apis_1	{"id": "microservices-and-apis", "tasks": [{"id": "http_status_check", "type": "io.kestra.plugin.core.flow.AllowFailure", "tasks": [{"id": "http_request", "uri": "{{ inputs.server_uri }}", "type": "io.kestra.plugin.core.http.Request", "options": {"allowFailed": "false", "defaultCharset": "UTF-8", "followRedirects": "true"}}, {"id": "check_status", "else": [{"id": "healthy", "type": "io.kestra.plugin.core.log.Log", "message": "Everything is fine!"}], "then": [{"id": "unhealthy", "type": "io.kestra.plugin.core.log.Log", "message": "Server is unhealthy! Response {{ outputs.http_request.body }}"}, {"id": "send_slack_alert", "url": "{{ inputs.slack_webhook_uri }}", "type": "io.kestra.plugin.notifications.slack.SlackIncomingWebhook", "payload": "{\\n  \\"channel\\": \\"#alerts\\",\\n  \\"text\\": \\"The server {{ inputs.server_uri }} is down!\\"\\n}\\n"}], "type": "io.kestra.plugin.core.flow.If", "condition": "{{ outputs.http_request.code != 200 }}"}], "errors": [{"id": "server_unreachable", "url": "{{ inputs.slack_webhook_uri }}", "type": "io.kestra.plugin.notifications.slack.SlackIncomingWebhook", "payload": "{\\n  \\"channel\\": \\"#alerts\\",\\n  \\"text\\": \\"The server {{ inputs.server_uri }} is unreachable!\\"\\n}\\n"}]}], "inputs": [{"id": "server_uri", "type": "URI", "defaults": "https://kestra.io", "required": true}, {"id": "slack_webhook_uri", "type": "URI", "defaults": "https://kestra.io/api/mock", "required": true}], "deleted": false, "disabled": false, "revision": 1, "triggers": [{"id": "daily", "cron": "0 9 * * *", "type": "io.kestra.plugin.core.trigger.Schedule", "disabled": true}], "namespace": "tutorial", "description": "Microservices and APIs"}	id: microservices-and-apis\nnamespace: tutorial\ndescription: Microservices and APIs\n\ninputs:\n  - id: server_uri\n    type: URI\n    defaults: https://kestra.io\n\n  - id: slack_webhook_uri\n    type: URI\n    defaults: https://kestra.io/api/mock\n\ntasks:\n  - id: http_status_check\n    type: io.kestra.plugin.core.flow.AllowFailure\n    tasks:\n      - id: http_request\n        type: io.kestra.plugin.core.http.Request\n        uri: "{{ inputs.server_uri }}"\n\n      - id: check_status\n        type: io.kestra.plugin.core.flow.If\n        condition: "{{ outputs.http_request.code != 200 }}"\n        then:\n          - id: unhealthy\n            type: io.kestra.plugin.core.log.Log\n            message: Server is unhealthy! Response {{ outputs.http_request.body }}\n\n          - id: send_slack_alert\n            type: io.kestra.plugin.notifications.slack.SlackIncomingWebhook\n            url: "{{ inputs.slack_webhook_uri }}"\n            payload: |\n              {\n                "channel": "#alerts",\n                "text": "The server {{ inputs.server_uri }} is down!"\n              }\n        else:\n          - id: healthy\n            type: io.kestra.plugin.core.log.Log\n            message: Everything is fine!\n\n    errors:\n      - id: server_unreachable\n        type: io.kestra.plugin.notifications.slack.SlackIncomingWebhook\n        url: "{{ inputs.slack_webhook_uri }}"\n        payload: |\n          {\n            "channel": "#alerts",\n            "text": "The server {{ inputs.server_uri }} is unreachable!"\n          }\n\ntriggers:\n  - id: daily\n    type: io.kestra.plugin.core.trigger.Schedule\n    disabled: true\n    cron: 0 9 * * *\n
