tutorial_business-automation_2	{"id": "business-automation", "tasks": [{"id": "working_directory", "type": "io.kestra.plugin.core.flow.WorkingDirectory", "tasks": [{"id": "query", "sql": "CREATE TABLE IF NOT EXISTS features (\\n    id INTEGER PRIMARY KEY,\\n    name TEXT NOT NULL,\\n    description TEXT NOT NULL,\\n    release_version TEXT NOT NULL,\\n    edition TEXT NOT NULL\\n);\\n\\nDELETE FROM features;\\n\\nINSERT INTO features (name, description, release_version, edition)\\nVALUES \\n    ('Worker Groups', 'Allows targeting specific tasks or triggers to run on specific remote workers for better scalability and resource management.', '0.10', 'Enterprise'),\\n    ('Realtime Triggers', 'Supports triggering event-driven workflows in real-time.', '0.17', 'Open-Source'),\\n    ('Task Runners', 'Provides on-demand remote execution environments for running tasks.', '0.16', 'Open-Source'),\\n    ('KV Store', 'Adds key-value storage for persisting data across workflow executions.', '0.18', 'Open-Source'),\\n    ('SCIM Directory Sync', 'Allows synchronization of users and groups from Identity Providers.', '0.18', 'Enterprise');  \\n    \\nSELECT * FROM features\\nORDER BY release_version;\\n", "url": "jdbc:sqlite:kestra.db", "type": "io.kestra.plugin.jdbc.sqlite.Queries", "fetchType": "STORE"}, {"id": "to_csv", "from": "{{ outputs.query.outputs[0].uri }}", "type": "io.kestra.plugin.serdes.csv.IonToCsv"}, {"id": "to_excel", "from": "{{ outputs.query.outputs[0].uri }}", "type": "io.kestra.plugin.serdes.excel.IonToExcel"}]}], "deleted": true, "disabled": false, "revision": 2, "namespace": "tutorial", "description": "Business Automation"}	id: business-automation\nnamespace: tutorial\ndescription: Business Automation\n\ntasks:\n  - id: working_directory\n    type: io.kestra.plugin.core.flow.WorkingDirectory\n    tasks:\n      - id: query\n        type: io.kestra.plugin.jdbc.sqlite.Queries\n        url: jdbc:sqlite:kestra.db\n        fetchType: STORE\n        sql: |\n          CREATE TABLE IF NOT EXISTS features (\n              id INTEGER PRIMARY KEY,\n              name TEXT NOT NULL,\n              description TEXT NOT NULL,\n              release_version TEXT NOT NULL,\n              edition TEXT NOT NULL\n          );\n\n          DELETE FROM features;\n\n          INSERT INTO features (name, description, release_version, edition)\n          VALUES \n              ('Worker Groups', 'Allows targeting specific tasks or triggers to run on specific remote workers for better scalability and resource management.', '0.10', 'Enterprise'),\n              ('Realtime Triggers', 'Supports triggering event-driven workflows in real-time.', '0.17', 'Open-Source'),\n              ('Task Runners', 'Provides on-demand remote execution environments for running tasks.', '0.16', 'Open-Source'),\n              ('KV Store', 'Adds key-value storage for persisting data across workflow executions.', '0.18', 'Open-Source'),\n              ('SCIM Directory Sync', 'Allows synchronization of users and groups from Identity Providers.', '0.18', 'Enterprise');  \n              \n          SELECT * FROM features\n          ORDER BY release_version;\n\n      - id: to_csv\n        type: io.kestra.plugin.serdes.csv.IonToCsv\n        from: "{{ outputs.query.outputs[0].uri }}"\n\n      - id: to_excel\n        type: io.kestra.plugin.serdes.excel.IonToExcel\n        from: "{{ outputs.query.outputs[0].uri }}"\n
