, click on the `Resume` button here http://localhost:8080/ui/executions/{{flow.namespace}}/{{flow.id}}/{{execution.id}}"\n      }\n\n  - id: wait_for_approval\n    type: io.kestra.plugin.core.flow.Pause\n\n  - id: process_request\n    type: io.kestra.plugin.core.http.Request\n    uri: https://kestra.io/api/mock\n    method: POST\n    contentType: application/json\n    body: "{{ inputs.request }}"\n
tutorial_data-engineering-pipeline_2	{"id": "data-engineering-pipeline", "tasks": [{"id": "extract", "uri": "https://dummyjson.com/products", "type": "io.kestra.plugin.core.http.Download", "options": {"allowFailed": "false", "defaultCharset": "UTF-8", "followRedirects": "true"}}, {"id": "transform", "type": "io.kestra.plugin.scripts.python.Script", "script": "import json\\nimport os\\n\\nwith open(\\"data.json\\", \\"r\\") as file:\\n    data = json.load(file)\\n\\nfiltered_data = [\\n    {column: product.get(column, \\"N/A\\") for column in {{ inputs.columns_to_keep }}}\\n    for product in data[\\"products\\"]\\n]\\n\\nwith open(\\"products.json\\", \\"w\\") as file:\\n    json.dump(filtered_data, file, indent=4)\\n", "inputFiles": {"data.json": "{{ outputs.extract.uri }}"}, "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "outputFiles": "[\\"*.json\\"]", "containerImage": "python:3.11-alpine"}, {"id": "query", "sql": "INSTALL json;\\nLOAD json;\\nSELECT brand, round(avg(price), 2) as avg_price\\nFROM read_json_auto('{{ workingDir }}/products.json')\\nGROUP BY brand\\nORDER BY avg_price DESC;\\n", "type": "io.kestra.plugin.jdbc.duckdb.Query", "fetchType": "STORE", "inputFiles": {"products.json": "{{ outputs.transform.outputFiles['products.json'] }}"}}], "inputs": [{"id": "columns_to_keep", "type": "ARRAY", "defaults": ["brand", "price"], "itemType": "STRING", "required": true}], "deleted": true, "disabled": false, "revision": 2, "namespace": "tutorial", "description": "Data Engineering Pipelines"}	id: data-engineering-pipeline\nnamespace: tutorial\ndescription: Data Engineering Pipelines\n\ninputs:\n  - id: columns_to_keep\n    type: ARRAY\n    itemType: STRING\n    defaults:\n      - brand\n      - price\n\ntasks:\n  - id: extract\n    type: io.kestra.plugin.core.http.Download\n    uri: https://dummyjson.com/products\n\n  - id: transform\n    type: io.kestra.plugin.scripts.python.Script\n    containerImage: python:3.11-alpine\n    inputFiles:\n      data.json: "{{ outputs.extract.uri }}"\n    outputFiles:\n      - "*.json"\n    script: |\n      import json\n      import os\n\n      with open("data.json", "r") as file:\n          data = json.load(file)\n\n      filtered_data = [\n          {column: product.get(column, "N/A") for column in {{ inputs.columns_to_keep }}}\n          for product in data["products"]\n      ]\n\n      with open("products.json", "w") as file:\n          json.dump(filtered_data, file, indent=4)\n\n  - id: query\n    type: io.kestra.plugin.jdbc.duckdb.Query\n    inputFiles:\n      products.json: "{{ outputs.transform.outputFiles['products.json'] }}"\n    sql: |\n      INSTALL json;\n      LOAD json;\n      SELECT brand, round(avg(price), 2) as avg_price\n      FROM read_json_auto('{{ workingDir }}/products.json')\n      GROUP BY brand\n      ORDER BY avg_price DESC;\n    fetchType: STORE\n
tutorial_dwh-and-analytics_2	{"id": "dwh-and-analytics", "tasks": [{"id": "dbt", "type": "io.kestra.plugin.core.flow.WorkingDirectory", "tasks": [{"id": "clone_repository", "url": "https://github.com/kestra-io/dbt-demo", "type": "io.kestra.plugin.git.Clone", "branch": "main"}, {"id": "dbt_build", "type": "io.kestra.plugin.dbt.cli.DbtCLI", "commands": "[\\"dbt deps\\",\\"dbt build\\"]", "profiles": "jaffle_shop:\\n  outputs:\\n    dev:\\n      type: duckdb\\n      path: dbt.duckdb\\n      extensions: \\n        - parquet\\n      fixed_retries: 1\\n      threads: 16\\n      timeout_seconds: 300\\n  target: dev      \\n", "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "containerImage": "ghcr.io/kestra-io/dbt-duckdb:latest"}, {"id": "python", "type": "io.kestra.plugin.scripts.python.Script", "script": "import duckdb\\nimport pandas as pd\\n\\nconn = duckdb.connect(database='dbt.duckdb', read_only=False)\\n\\ntables_query = \\"SELECT table_name FROM information_schema.tables WHERE table_schema = 'main';\\"\\n\\ntables = conn.execute(tables_query).fetchall()\\n\\n# Export each table to CSV, excluding tables that start with 'raw' or\\n'stg'\\n\\nfor table_name in tables:\\n    table_name = table_name[0]\\n    # Skip tables with names starting with 'raw' or 'stg'\\n    if not table_name.startswith('raw') and not table_name.startswith('stg'):\\n        query = f\\"SELECT * FROM {table_name}\\"\\n        df = conn.execute(query).fetchdf()\\n        df.to_csv(f\\"{table_name}.csv\\", index=False)\\n\\nconn.close()\\n", "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "outputFiles": "[\\"*.csv\\"]", "containerImage": "ghcr.io/kestra-io/duckdb:latest"}]}], "deleted": true, "disabled": false, "revision": 2, "namespace": "tutorial", "description": "Data Warehouse and Analytics"}	id: dwh-and-analytics\nnamespace: tutorial\ndescription: Data Warehouse and Analytics\n\ntasks:\n  - id: dbt\n    type: io.kestra.plugin.core.flow.WorkingDirectory\n    tasks:\n      - id: clone_repository\n        type: io.kestra.plugin.git.Clone\n        url: https://github.com/kestra-io/dbt-demo\n        branch: main\n\n      - id: dbt_build\n        type: io.kestra.plugin.dbt.cli.DbtCLI\n        taskRunner:\n          type: io.kestra.plugin.scripts.runner.docker.Docker\n        containerImage: ghcr.io/kestra-io/dbt-duckdb:latest\n        commands:\n          - dbt deps\n          - dbt build\n        profiles: |\n          jaffle_shop:\n            outputs:\n              dev:\n                type: duckdb\n                path: dbt.duckdb\n                extensions: \n                  - parquet\n                fixed_retries: 1\n                threads: 16\n                timeout_seconds: 300\n            target: dev      \n\n      - id: python\n        type: io.kestra.plugin.scripts.python.Script\n        outputFiles:\n          - "*.csv"\n        taskRunner:\n          type: io.kestra.plugin.scripts.runner.docker.Docker\n        containerImage: ghcr.io/kestra-io/duckdb:latest\n        script: |\n          import duckdb\n          import pandas as pd\n\n          conn = duckdb.connect(database='dbt.duckdb', read_only=False)\n\n          tables_query = "SELECT table_name FROM information_schema.tables WHERE table_schema = 'main';"\n\n          tables = conn.execute(tables_query).fetchall()\n\n          # Export each table to CSV, excluding tables that start with 'raw' or\n          'stg'\n\n          for table_name in tables:\n              table_name = table_name[0]\n              # Skip tables with names starting with 'raw' or 'stg'\n              if not table_name.startswith('raw') and not table_name.startswith('stg'):\n                  query = f"SELECT * FROM {table_name}"\n                  df = conn.execute(query).fetchdf()\n                  df.to_csv(f"{table_name}.csv", index=False)\n\n          conn.close()\n
tutorial_file-processing_2	{"id": "file-processing", "tasks": [{"id": "get_zipfile", "uri": "https://divvy-tripdata.s3.amazonaws.com/{{ render(vars.file_id) }}-divvy-tripdata.zip", "type": "io.kestra.plugin.core.http.Download", "options": {"allowFailed": "false", "defaultCharset": "UTF-8", "followRedirects": "true"}}, {"id": "unzip", "from": "{{ outputs.get_zipfile.uri }}", "type": "io.kestra.plugin.compress.ArchiveDecompress", "algorithm": "ZIP"}, {"id": "csv_to_ion", "from": "{{outputs.unzip.files[render(vars.file_id) ~ '-divvy-tripdata.csv']}}", "type": "io.kestra.plugin.serdes.csv.CsvToIon"}, {"id": "to_parquet", "from": "{{ outputs.csv_to_ion.uri }}", "type": "io.kestra.plugin.serdes.avro.IonToAvro", "schema": "{\\n  \\"type\\": \\"record\\",\\n  \\"name\\": \\"Ride\\",\\n  \\"namespace\\": \\"com.example.bikeshare\\",\\n  \\"fields\\": [\\n    {\\"name\\": \\"ride_id\\", \\"type\\": \\"string\\"},\\n    {\\"name\\": \\"rideable_type\\", \\"type\\": \\"string\\"},\\n    {\\"name\\": \\"started_at\\", \\"type\\": {\\"type\\": \\"long\\", \\"logicalType\\": \\"timestamp-millis\\"}},\\n    {\\"name\\": \\"ended_at\\", \\"type\\": {\\"type\\": \\"long\\", \\"logicalType\\": \\"timestamp-millis\\"}},\\n    {\\"name\\": \\"start_station_name\\", \\"type\\": \\"string\\"},\\n    {\\"name\\": \\"start_station_id\\", \\"type\\": \\"string\\"},\\n    {\\"name\\": \\"end_station_name\\", \\"type\\": \\"string\\"},\\n    {\\"name\\": \\"end_station_id\\", \\"type\\": \\"string\\"},\\n    {\\"name\\": \\"start_lat\\", \\"type\\": \\"double\\"},\\n    {\\"name\\": \\"start_lng\\", \\"type\\": \\"double\\"},\\n    {\\n      \\"name\\": \\"end_lat\\", \\n      \\"type\\": [\\"null\\", \\"double\\"],\\n      \\"default\\": null\\n    },\\n    {\\n      \\"name\\": \\"end_lng\\",\\n      \\"type\\": [\\"null\\", \\"double\\"],\\n      \\"default\\": null\\n    },\\n    {\\"name\\": \\"member_casual\\", \\"type\\": \\"string\\"}\\n  ]\\n}\\n", "datetimeFormat": "yyyy-MM-dd' 'HH:mm:ss"}], "deleted": true, "disabled": false, "revision": 2, "namespace": "tutorial", "variables": {"file_id": 202403}, "description": "File Processing"}	id: file-processing\nnamespace: tutorial\ndescription: File Processing\n\nvariables:\n  file_id: 202403\n\ntasks:\n  - id: get_zipfile\n    type: io.kestra.plugin.core.http.Download\n    uri: https://divvy-tripdata.s3.amazonaws.com/{{ render(vars.file_id)\n      }}-divvy-tripdata.zip\n\n  - id: unzip\n    type: io.kestra.plugin.compress.ArchiveDecompress\n    algorithm: ZIP\n    from: "{{ outputs.get_zipfile.uri }}"\n\n  - id: csv_to_ion\n    type: io.kestra.plugin.serdes.csv.CsvToIon\n    from: "{{outputs.unzip.files[render(vars.file_id) ~ '-divvy-tripdata.csv']}}"\n\n  - id: to_parquet\n    type: io.kestra.plugin.serdes.avro.IonToAvro\n    from: "{{ outputs.csv_to_ion.uri }}"\n    datetimeFormat: yyyy-MM-dd' 'HH:mm:ss\n    schema: |\n      {\n        "type": "record",\n        "name": "Ride",\n        "namespace": "com.example.bikeshare",\n        "fields": [\n          {"name": "ride_id", "type": "string"},\n          {"name": "rideable_type", "type": "string"},\n          {"name": "started_at", "type": {"type": "long", "logicalType": "timestamp-millis"}},\n          {"name": "ended_at", "type": {"type": "long", "logicalType": "timestamp-millis"}},\n          {"name": "start_station_name", "type": "string"},\n          {"name": "start_station_id", "type": "string"},\n          {"name": "end_station_name", "type": "string"},\n          {"name": "end_station_id", "type": "string"},\n          {"name": "start_lat", "type": "double"},\n          {"name": "start_lng", "type": "double"},\n          {\n            "name": "end_lat", \n            "type": ["null", "double"],\n            "default": null\n          },\n          {\n            "name": "end_lng",\n            "type": ["null", "double"],\n            "default": null\n          },\n          {"name": "member_casual", "type": "string"}\n        ]\n      }\n
tutorial_hello-world_2	{"id": "hello-world", "tasks": [{"id": "first_task", "type": "io.kestra.plugin.core.debug.Return", "format": "thrilled"}, {"id": "second_task", "type": "io.kestra.plugin.scripts.shell.Commands", "commands": "[\\"sleep 0.42\\",\\"echo '::{\\\\\\"outputs\\\\\\":{\\\\\\"returned_data\\\\\\":\\\\\\"mydata\\\\\\"}}::'\\"]", "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}}, {"id": "hello_world", "type": "io.kestra.plugin.core.log.Log", "message": "Welcome to Kestra, {{ inputs.user }}! \\nWe are {{ outputs.first_task.value}} to have You here!\\n"}], "inputs": [{"id": "user", "type": "STRING", "defaults": "Rick Astley", "required": true}], "deleted": true, "disabled": false, "revision": 2, "triggers": [{"id": "daily", "cron": "0 9 * * *", "type": "io.kestra.plugin.core.trigger.Schedule", "disabled": true}], "namespace": "tutorial", "description": "Hello World"}	id: hello-world\nnamespace: tutorial\ndescription: Hello World\n\ninputs:\n  - id: user\n    type: STRING\n    defaults: Rick Astley\n\ntasks:\n  - id: first_task\n    type: io.kestra.plugin.core.debug.Return\n    format: thrilled\n\n  - id: second_task\n    type: io.kestra.plugin.scripts.shell.Commands\n    commands:\n      - sleep 0.42\n      - echo '::{"outputs":{"returned_data":"mydata"}}::'\n\n  - id: hello_world\n    type: io.kestra.plugin.core.log.Log\n    message: |\n      Welcome to Kestra, {{ inputs.user }}! \n      We are {{ outputs.first_task.value}} to have You here!\n\ntriggers:\n  - id: daily\n    type: io.kestra.plugin.core.trigger.Schedule\n    disabled: true\n    cron: 0 9 * * *\n
tutorial_infrastructure-automation_2	{"id": "infrastructure-automation", "tasks": [{"id": "build_image", "tags": "[\\"{{ inputs.docker_image }}\\"]", "type": "io.kestra.plugin.docker.Build", "dockerfile": "FROM python:3.11-alpine\\nRUN pip install --no-cache-dir kestra\\n", "credentials": {"password": "{{ kv('DOCKERHUB_PASSWORD', errorOnMissing=false) }}", "registry": "https://index.docker.io/v1/", "username": "{{ kv('DOCKERHUB_USERNAME', errorOnMissing=false) }}"}}, {"id": "run_container", "type": "io.kestra.plugin.docker.Run", "commands": "[\\"pip\\",\\"show\\",\\"kestra\\"]", "pullPolicy": "NEVER", "containerImage": "{{ inputs.docker_image }}"}, {"id": "run_terraform", "type": "io.kestra.plugin.terraform.cli.TerraformCLI", "commands": "[\\"terraform plan 2>&1 | tee plan_output.txt\\",\\"terraform apply -auto-approve 2>&1 | tee apply_output.txt\\"]", "inputFiles": {"main.tf": "terraform {\\n  required_providers {\\n    http = {\\n      source = \\"hashicorp/http\\"\\n    }\\n    local = {\\n      source = \\"hashicorp/local\\"\\n    }\\n  }\\n}\\n\\nprovider \\"http\\" {}\\nprovider \\"local\\" {}\\n\\nvariable \\"pokemon_names\\" {\\n  type    = list(string)\\n  default = [\\"pikachu\\", \\"psyduck\\", \\"charmander\\", \\"bulbasaur\\"]\\n}\\n\\ndata \\"http\\" \\"pokemon\\" {\\n  count = length(var.pokemon_names)\\n  url   = \\"https://pokeapi.co/api/v2/pokemon/${var.pokemon_names[count.index]}\\"\\n}\\n\\nlocals {\\n  pokemon_details = [for i in range(length(var.pokemon_names)) : {\\n    name  = jsondecode(data.http.pokemon[i].response_body)[\\"name\\"]\\n    types = join(\\", \\", [for type in jsondecode(data.http.pokemon[i].response_body)[\\"types\\"] : type[\\"type\\"][\\"name\\"]])\\n  }]\\n\\n  file_content = join(\\"\\\\n\\\\n\\", [for detail in local.pokemon_details : \\"Name: ${detail.name}\\\\nTypes: ${detail.types}\\"])\\n}\\n\\nresource \\"local_file\\" \\"pokemon_details_file\\" {\\n  filename = \\"${path.module}/pokemon.txt\\"\\n  content  = local.file_content\\n}\\n\\noutput \\"file_path\\" {\\n  value = local_file.pokemon_details_file.filename\\n}\\n"}, "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "outputFiles": "[\\"*.txt\\"]", "beforeCommands": "[\\"terraform init\\"]"}, {"id": "log_pokemon", "type": "io.kestra.plugin.core.log.Log", "message": "{{ read(outputs.run_terraform.outputFiles['pokemon.txt']) }}"}], "inputs": [{"id": "docker_image", "type": "STRING", "defaults": "kestra/myimage:latest", "required": true}], "deleted": true, "disabled": false, "revision": 2, "namespace": "tutorial", "description": "Infrastructure Automation"}	id: infrastructure-automation\nnamespace: tutorial\ndescription: Infrastructure Automation\n\ninputs:\n  - id: docker_image\n    type: STRING\n    defaults: kestra/myimage:latest\n\ntasks:\n  - id: build_image\n    type: io.kestra.plugin.docker.Build\n    dockerfile: |\n      FROM python:3.11-alpine\n      RUN pip install --no-cache-dir kestra\n    tags:\n      - "{{ inputs.docker_image }}"\n    push: false # you can change this to true after adding credentials\n    credentials:\n      registry: https://index.docker.io/v1/\n      username: "{{ kv('DOCKERHUB_USERNAME', errorOnMissing=false) }}"\n      password: "{{ kv('DOCKERHUB_PASSWORD', errorOnMissing=false) }}"\n\n  - id: run_container\n    type: io.kestra.plugin.docker.Run\n    pullPolicy: NEVER # to use the local image we've just built\n    containerImage: "{{ inputs.docker_image }}"\n    commands:\n      - pip\n      - show\n      - kestra\n\n  - id: run_terraform\n    type: io.kestra.plugin.terraform.cli.TerraformCLI\n    beforeCommands:\n      - terraform init\n    commands:\n      - terraform plan 2>&1 | tee plan_output.txt\n      - terraform apply -auto-approve 2>&1 | tee apply_output.txt\n    outputFiles:\n      - "*.txt"\n    inputFiles:\n      main.tf: |\n        terraform {\n          required_providers {\n            http = {\n              source = "hashicorp/http"\n            }\n            local = {\n              source = "hashicorp/local"\n            }\n          }\n        }\n\n        provider "http" {}\n        provider "local" {}\n\n        variable "pokemon_names" {\n          type    = list(string)\n          default = ["pikachu", "psyduck", "charmander", "bulbasaur"]\n        }\n\n        data "http" "pokemon" {\n          count = length(var.pokemon_names)\n          url   = "https://pokeapi.co/api/v2/pokemon/${var.pokemon_names[count.index]}"\n        }\n\n        locals {\n          pokemon_details = [for i in range(length(var.pokemon_names)) : {\n            name  = jsondecode(data.http.pokemon[i].response_body)["name"]\n            types = join(", ", [for type in jsondecode(data.http.pokemon[i].response_body)["types"] : type["type"]["name"]])\n          }]\n\n          file_content = join("\\n\\n", [for detail in local.pokemon_details : "Name: ${detail.name}\\nTypes: ${detail.types}"])\n        }\n\n        resource "local_file" "pokemon_details_file" {\n          filename = "${path.module}/pokemon.txt"\n          content  = local.file_content\n        }\n\n        output "file_path" {\n          value = local_file.pokemon_details_file.filename\n        }\n\n  - id: log_pokemon\n    type: io.kestra.plugin.core.log.Log\n    message: "{{ read(outputs.run_terraform.outputFiles['pokemon.txt']) }}"\n
