tutorial_microservices-and-apis_2	{"id": "microservices-and-apis", "tasks": [{"id": "http_status_check", "type": "io.kestra.plugin.core.flow.AllowFailure", "tasks": [{"id": "http_request", "uri": "{{ inputs.server_uri }}", "type": "io.kestra.plugin.core.http.Request", "options": {"allowFailed": "false", "defaultCharset": "UTF-8", "followRedirects": "true"}}, {"id": "check_status", "else": [{"id": "healthy", "type": "io.kestra.plugin.core.log.Log", "message": "Everything is fine!"}], "then": [{"id": "unhealthy", "type": "io.kestra.plugin.core.log.Log", "message": "Server is unhealthy! Response {{ outputs.http_request.body }}"}, {"id": "send_slack_alert", "url": "{{ inputs.slack_webhook_uri }}", "type": "io.kestra.plugin.notifications.slack.SlackIncomingWebhook", "payload": "{\\n  \\"channel\\": \\"#alerts\\",\\n  \\"text\\": \\"The server {{ inputs.server_uri }} is down!\\"\\n}\\n"}], "type": "io.kestra.plugin.core.flow.If", "condition": "{{ outputs.http_request.code != 200 }}"}], "errors": [{"id": "server_unreachable", "url": "{{ inputs.slack_webhook_uri }}", "type": "io.kestra.plugin.notifications.slack.SlackIncomingWebhook", "payload": "{\\n  \\"channel\\": \\"#alerts\\",\\n  \\"text\\": \\"The server {{ inputs.server_uri }} is unreachable!\\"\\n}\\n"}]}], "inputs": [{"id": "server_uri", "type": "URI", "defaults": "https://kestra.io", "required": true}, {"id": "slack_webhook_uri", "type": "URI", "defaults": "https://kestra.io/api/mock", "required": true}], "deleted": true, "disabled": false, "revision": 2, "triggers": [{"id": "daily", "cron": "0 9 * * *", "type": "io.kestra.plugin.core.trigger.Schedule", "disabled": true}], "namespace": "tutorial", "description": "Microservices and APIs"}	id: microservices-and-apis\nnamespace: tutorial\ndescription: Microservices and APIs\n\ninputs:\n  - id: server_uri\n    type: URI\n    defaults: https://kestra.io\n\n  - id: slack_webhook_uri\n    type: URI\n    defaults: https://kestra.io/api/mock\n\ntasks:\n  - id: http_status_check\n    type: io.kestra.plugin.core.flow.AllowFailure\n    tasks:\n      - id: http_request\n        type: io.kestra.plugin.core.http.Request\n        uri: "{{ inputs.server_uri }}"\n\n      - id: check_status\n        type: io.kestra.plugin.core.flow.If\n        condition: "{{ outputs.http_request.code != 200 }}"\n        then:\n          - id: unhealthy\n            type: io.kestra.plugin.core.log.Log\n            message: Server is unhealthy! Response {{ outputs.http_request.body }}\n\n          - id: send_slack_alert\n            type: io.kestra.plugin.notifications.slack.SlackIncomingWebhook\n            url: "{{ inputs.slack_webhook_uri }}"\n            payload: |\n              {\n                "channel": "#alerts",\n                "text": "The server {{ inputs.server_uri }} is down!"\n              }\n        else:\n          - id: healthy\n            type: io.kestra.plugin.core.log.Log\n            message: Everything is fine!\n\n    errors:\n      - id: server_unreachable\n        type: io.kestra.plugin.notifications.slack.SlackIncomingWebhook\n        url: "{{ inputs.slack_webhook_uri }}"\n        payload: |\n          {\n            "channel": "#alerts",\n            "text": "The server {{ inputs.server_uri }} is unreachable!"\n          }\n\ntriggers:\n  - id: daily\n    type: io.kestra.plugin.core.trigger.Schedule\n    disabled: true\n    cron: 0 9 * * *\n
zoomcamp_01_getting_started_data_pipeline_1	{"id": "01_getting_started_data_pipeline", "tasks": [{"id": "extract", "uri": "https://dummyjson.com/products", "type": "io.kestra.plugin.core.http.Download", "options": {"allowFailed": "false", "defaultCharset": "UTF-8", "followRedirects": "true"}}, {"id": "transform", "env": "{\\"COLUMNS_TO_KEEP\\":\\"{{inputs.columns_to_keep}}\\"}", "type": "io.kestra.plugin.scripts.python.Script", "script": "import json\\nimport os\\n\\ncolumns_to_keep_str = os.getenv(\\"COLUMNS_TO_KEEP\\")\\ncolumns_to_keep = json.loads(columns_to_keep_str)\\n\\nwith open(\\"data.json\\", \\"r\\") as file:\\n    data = json.load(file)\\n\\nfiltered_data = [\\n    {column: product.get(column, \\"N/A\\") for column in columns_to_keep}\\n    for product in data[\\"products\\"]\\n]\\n\\nwith open(\\"products.json\\", \\"w\\") as file:\\n    json.dump(filtered_data, file, indent=4)\\n", "inputFiles": {"data.json": "{{outputs.extract.uri}}"}, "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "outputFiles": "[\\"*.json\\"]", "containerImage": "python:3.11-alpine"}, {"id": "query", "sql": "INSTALL json;\\nLOAD json;\\nSELECT brand, round(avg(price), 2) as avg_price\\nFROM read_json_auto('{{workingDir}}/products.json')\\nGROUP BY brand\\nORDER BY avg_price DESC;\\n", "type": "io.kestra.plugin.jdbc.duckdb.Query", "fetchType": "STORE", "inputFiles": {"products.json": "{{outputs.transform.outputFiles['products.json']}}"}}], "inputs": [{"id": "columns_to_keep", "type": "ARRAY", "defaults": ["brand", "price"], "itemType": "STRING", "required": true}], "deleted": false, "disabled": false, "revision": 1, "namespace": "zoomcamp"}	id: 01_getting_started_data_pipeline\nnamespace: zoomcamp\n\ninputs:\n  - id: columns_to_keep\n    type: ARRAY\n    itemType: STRING\n    defaults:\n      - brand\n      - price\n\ntasks:\n  - id: extract\n    type: io.kestra.plugin.core.http.Download\n    uri: https://dummyjson.com/products\n\n  - id: transform\n    type: io.kestra.plugin.scripts.python.Script\n    containerImage: python:3.11-alpine\n    inputFiles:\n      data.json: "{{outputs.extract.uri}}"\n    outputFiles:\n      - "*.json"\n    env:\n      COLUMNS_TO_KEEP: "{{inputs.columns_to_keep}}"\n    script: |\n      import json\n      import os\n\n      columns_to_keep_str = os.getenv("COLUMNS_TO_KEEP")\n      columns_to_keep = json.loads(columns_to_keep_str)\n\n      with open("data.json", "r") as file:\n          data = json.load(file)\n\n      filtered_data = [\n          {column: product.get(column, "N/A") for column in columns_to_keep}\n          for product in data["products"]\n      ]\n\n      with open("products.json", "w") as file:\n          json.dump(filtered_data, file, indent=4)\n\n  - id: query\n    type: io.kestra.plugin.jdbc.duckdb.Query\n    inputFiles:\n      products.json: "{{outputs.transform.outputFiles['products.json']}}"\n    sql: |\n      INSTALL json;\n      LOAD json;\n      SELECT brand, round(avg(price), 2) as avg_price\n      FROM read_json_auto('{{workingDir}}/products.json')\n      GROUP BY brand\n      ORDER BY avg_price DESC;\n    fetchType: STORE\n
