\nnamespace: zoomcamp\\ndescription: |\\n  Best to add a label `backfill:true` from the UI to track executions created via a backfill.\\n  CSV data used here comes from: https://github.com/DataTalksClub/nyc-tlc-data/releases\\n\\nconcurrency:\\n  limit: 1\\n\\ninputs:\\n  - id: taxi\\n    type: SELECT\\n    displayName: Select taxi type\\n    values: [yellow, green]\\n    defaults: yellow\\n\\nvariables:\\n  file: \\"{{inputs.taxi}}_tripdata_{{trigger.date | date('yyyy-MM')}}.csv\\"\\n  staging_table: \\"public.{{inputs.taxi}}_tripdata_staging\\"\\n  table: \\"public.{{inputs.taxi}}_tripdata\\"\\n  data: \\"{{outputs.extract.outputFiles[inputs.taxi ~ '_tripdata_' ~ (trigger.date | date('yyyy-MM')) ~ '.csv']}}\\"\\n\\ntasks:\\n  - id: set_label\\n    type: io.kestra.plugin.core.execution.Labels\\n    labels:\\n      file: \\"{{render(vars.file)}}\\"\\n      taxi: \\"{{inputs.taxi}}\\"\\n\\n  - id: extract\\n    type: io.kestra.plugin.scripts.shell.Commands\\n    outputFiles:\\n      - \\"*.csv\\"\\n    taskRunner:\\n      type: io.kestra.plugin.core.runner.Process\\n    commands:\\n      - wget -qO- https://github.com/DataTalksClub/nyc-tlc-data/releases/download/{{inputs.taxi}}/{{render(vars.file)}}.gz | gunzip > {{render(vars.file)}}\\n\\n  - id: if_yellow_taxi\\n    type: io.kestra.plugin.core.flow.If\\n    condition: \\"{{inputs.taxi == 'yellow'}}\\"\\n    then:\\n      - id: yellow_create_table\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          CREATE TABLE IF NOT EXISTS {{render(vars.table)}} (\\n              unique_row_id          text,\\n              filename               text,\\n              VendorID               text,\\n              tpep_pickup_datetime   timestamp,\\n              tpep_dropoff_datetime  timestamp,\\n              passenger_count        integer,\\n              trip_distance          double precision,\\n              RatecodeID             text,\\n              store_and_fwd_flag     text,\\n              PULocationID           text,\\n              DOLocationID           text,\\n              payment_type           integer,\\n              fare_amount            double precision,\\n              extra                  double precision,\\n              mta_tax                double precision,\\n              tip_amount             double precision,\\n              tolls_amount           double precision,\\n              improvement_surcharge  double precision,\\n              total_amount           double precision,\\n              congestion_surcharge   double precision\\n          );\\n\\n      - id: yellow_create_staging_table\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          CREATE TABLE IF NOT EXISTS {{render(vars.staging_table)}} (\\n              unique_row_id          text,\\n              filename               text,\\n              VendorID               text,\\n              tpep_pickup_datetime   timestamp,\\n              tpep_dropoff_datetime  timestamp,\\n              passenger_count        integer,\\n              trip_distance          double precision,\\n              RatecodeID             text,\\n              store_and_fwd_flag     text,\\n              PULocationID           text,\\n              DOLocationID           text,\\n              payment_type           integer,\\n              fare_amount            double precision,\\n              extra                  double precision,\\n              mta_tax                double precision,\\n              tip_amount             double precision,\\n              tolls_amount           double precision,\\n              improvement_surcharge  double precision,\\n              total_amount           double precision,\\n              congestion_surcharge   double precision\\n          );\\n\\n      - id: yellow_truncate_staging_table\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          TRUNCATE TABLE {{render(vars.staging_table)}};\\n\\n      - id: yellow_copy_in_to_staging_table\\n        type: io.kestra.plugin.jdbc.postgresql.CopyIn\\n        format: CSV\\n        from: \\"{{render(vars.data)}}\\"\\n        table: \\"{{render(vars.staging_table)}}\\"\\n        header: true\\n        columns: [VendorID,tpep_pickup_datetime,tpep_dropoff_datetime,passenger_count,trip_distance,RatecodeID,store_and_fwd_flag,PULocationID,DOLocationID,payment_type,fare_amount,extra,mta_tax,tip_amount,tolls_amount,improvement_surcharge,total_amount,congestion_surcharge]\\n\\n      - id: yellow_add_unique_id_and_filename\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          UPDATE {{render(vars.staging_table)}}\\n          SET \\n            unique_row_id = md5(\\n              COALESCE(CAST(VendorID AS text), '') ||\\n              COALESCE(CAST(tpep_pickup_datetime AS text), '') || \\n              COALESCE(CAST(tpep_dropoff_datetime AS text), '') || \\n              COALESCE(PULocationID, '') || \\n              COALESCE(DOLocationID, '') || \\n              COALESCE(CAST(fare_amount AS text), '') || \\n              COALESCE(CAST(trip_distance AS text), '')      \\n            ),\\n            filename = '{{render(vars.file)}}';\\n\\n      - id: yellow_merge_data\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          MERGE INTO {{render(vars.table)}} AS T\\n          USING {{render(vars.staging_table)}} AS S\\n          ON T.unique_row_id = S.unique_row_id\\n          WHEN NOT MATCHED THEN\\n            INSERT (\\n              unique_row_id, filename, VendorID, tpep_pickup_datetime, tpep_dropoff_datetime,\\n              passenger_count, trip_distance, RatecodeID, store_and_fwd_flag, PULocationID,\\n              DOLocationID, payment_type, fare_amount, extra, mta_tax, tip_amount, tolls_amount,\\n              improvement_surcharge, total_amount, congestion_surcharge\\n            )\\n            VALUES (\\n              S.unique_row_id, S.filename, S.VendorID, S.tpep_pickup_datetime, S.tpep_dropoff_datetime,\\n              S.passenger_count, S.trip_distance, S.RatecodeID, S.store_and_fwd_flag, S.PULocationID,\\n              S.DOLocationID, S.payment_type, S.fare_amount, S.extra, S.mta_tax, S.tip_amount, S.tolls_amount,\\n              S.improvement_surcharge, S.total_amount, S.congestion_surcharge\\n            );\\n\\n  - id: if_green_taxi\\n    type: io.kestra.plugin.core.flow.If\\n    condition: \\"{{inputs.taxi == 'green'}}\\"\\n    then:\\n      - id: green_create_table\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          CREATE TABLE IF NOT EXISTS {{render(vars.table)}} (\\n              unique_row_id          text,\\n              filename               text,\\n              VendorID               text,\\n              lpep_pickup_datetime   timestamp,\\n              lpep_dropoff_datetime  timestamp,\\n              store_and_fwd_flag     text,\\n              RatecodeID             text,\\n              PULocationID           text,\\n              DOLocationID           text,\\n              passenger_count        integer,\\n              trip_distance          double precision,\\n              fare_amount            double precision,\\n              extra                  double precision,\\n              mta_tax                double precision,\\n              tip_amount             double precision,\\n              tolls_amount           double precision,\\n              ehail_fee              double precision,\\n              improvement_surcharge  double precision,\\n              total_amount           double precision,\\n              payment_type           integer,\\n              trip_type              integer,\\n              congestion_surcharge   double precision\\n          );\\n\\n      - id: green_create_staging_table\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          CREATE TABLE IF NOT EXISTS {{render(vars.staging_table)}} (\\n              unique_row_id          text,\\n              filename               text,\\n              VendorID               text,\\n              lpep_pickup_datetime   timestamp,\\n              lpep_dropoff_datetime  timestamp,\\n              store_and_fwd_flag     text,\\n              RatecodeID             text,\\n              PULocationID           text,\\n              DOLocationID           text,\\n              passenger_count        integer,\\n              trip_distance          double precision,\\n              fare_amount            double precision,\\n              extra                  double precision,\\n              mta_tax                double precision,\\n              tip_amount             double precision,\\n              tolls_amount           double precision,\\n              ehail_fee              double precision,\\n              improvement_surcharge  double precision,\\n              total_amount           double precision,\\n              payment_type           integer,\\n              trip_type              integer,\\n              congestion_surcharge   double precision\\n          );\\n\\n      - id: green_truncate_staging_table\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          TRUNCATE TABLE {{render(vars.staging_table)}};\\n\\n      - id: green_copy_in_to_staging_table\\n        type: io.kestra.plugin.jdbc.postgresql.CopyIn\\n        format: CSV\\n        from: \\"{{render(vars.data)}}\\"\\n        table: \\"{{render(vars.staging_table)}}\\"\\n        header: true\\n        columns: [VendorID,lpep_pickup_datetime,lpep_dropoff_datetime,store_and_fwd_flag,RatecodeID,PULocationID,DOLocationID,passenger_count,trip_distance,fare_amount,extra,mta_tax,tip_amount,tolls_amount,ehail_fee,improvement_surcharge,total_amount,payment_type,trip_type,congestion_surcharge]\\n\\n      - id: green_add_unique_id_and_filename\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          UPDATE {{render(vars.staging_table)}}\\n          SET \\n            unique_row_id = md5(\\n              COALESCE(CAST(VendorID AS text), '') ||\\n              COALESCE(CAST(lpep_pickup_datetime AS text), '') || \\n              COALESCE(CAST(lpep_dropoff_datetime AS text), '') || \\n              COALESCE(PULocationID, '') || \\n              COALESCE(DOLocationID, '') || \\n              COALESCE(CAST(fare_amount AS text), '') || \\n              COALESCE(CAST(trip_distance AS text), '')      \\n            ),\\n            filename = '{{render(vars.file)}}';\\n\\n      - id: green_merge_data\\n        type: io.kestra.plugin.jdbc.postgresql.Queries\\n        sql: |\\n          MERGE INTO {{render(vars.table)}} AS T\\n          USING {{render(vars.staging_table)}} AS S\\n          ON T.unique_row_id = S.unique_row_id\\n          WHEN NOT MATCHED THEN\\n            INSERT (\\n              unique_row_id, filename, VendorID, lpep_pickup_datetime, lpep_dropoff_datetime,\\n              store_and_fwd_flag, RatecodeID, PULocationID, DOLocationID, passenger_count,\\n              trip_distance, fare_amount, extra, mta_tax, tip_amount, tolls_amount, ehail_fee,\\n              improvement_surcharge, total_amount, payment_type, trip_type, congestion_surcharge\\n            )\\n            VALUES (\\n              S.unique_row_id, S.filename, S.VendorID, S.lpep_pickup_datetime, S.lpep_dropoff_datetime,\\n              S.store_and_fwd_flag, S.RatecodeID, S.PULocationID, S.DOLocationID, S.passenger_count,\\n              S.trip_distance, S.fare_amount, S.extra, S.mta_tax, S.tip_amount, S.tolls_amount, S.ehail_fee,\\n              S.improvement_surcharge, S.total_amount, S.payment_type, S.trip_type, S.congestion_surcharge\\n            );\\n  \\n  - id: purge_files\\n    type: io.kestra.plugin.core.storage.PurgeCurrentExecutionFiles\\n    description: To avoid cluttering your storage, we will remove the downloaded files\\n\\npluginDefaults:\\n  - type: io.kestra.plugin.jdbc.postgresql\\n    values:\\n      url: jdbc:postgresql://host.docker.internal:5432/postgres-zoomcamp\\n      username: kestra\\n      password: k3str4\\n\\ntriggers:\\n  - id: green_schedule\\n    type: io.kestra.plugin.core.trigger.Schedule\\n    cron: \\"0 9 1 * *\\"\\n    inputs:\\n      taxi: green\\n\\n  - id: yellow_schedule\\n    type: io.kestra.plugin.core.trigger.Schedule\\n    cron: \\"0 10 1 * *\\"\\n    inputs:\\n      taxi: yellow\\n", "deleted": false, "disabled": false, "revision": 1, "triggers": [{"id": "green_schedule", "cron": "0 9 1 * *", "type": "io.kestra.plugin.core.trigger.Schedule", "inputs": {"taxi": "green"}}, {"id": "yellow_schedule", "cron": "0 10 1 * *", "type": "io.kestra.plugin.core.trigger.Schedule", "inputs": {"taxi": "yellow"}}], "namespace": "zoomcamp", "variables": {"data": "{{outputs.extract.outputFiles[inputs.taxi ~ '_tripdata_' ~ (trigger.date | date('yyyy-MM')) ~ '.csv']}}", "file": "{{inputs.taxi}}_tripdata_{{trigger.date | date('yyyy-MM')}}.csv", "table": "public.{{inputs.taxi}}_tripdata", "staging_table": "public.{{inputs.taxi}}_tripdata_staging"}, "concurrency": {"limit": 1, "behavior": "QUEUE"}, "description": "Best to add a label `backfill:true` from the UI to track executions created via a backfill.\\nCSV data used here comes from: https://github.com/DataTalksClub/nyc-tlc-data/releases\\n", "pluginDefaults": [{"type": "io.kestra.plugin.jdbc.postgresql", "forced": false, "values": {"url": "jdbc:postgresql://host.docker.internal:5432/postgres-zoomcamp", "password": "k3str4", "username": "kestra"}}]}	2025-05-17 14:47:48.01664+00	f	f	f	f	t	\N
