36	io.kestra.core.models.flows.FlowWithSource	tutorial_dwh-and-analytics_2	{"id": "dwh-and-analytics", "tasks": [{"id": "dbt", "type": "io.kestra.plugin.core.flow.WorkingDirectory", "tasks": [{"id": "clone_repository", "url": "https://github.com/kestra-io/dbt-demo", "type": "io.kestra.plugin.git.Clone", "branch": "main"}, {"id": "dbt_build", "type": "io.kestra.plugin.dbt.cli.DbtCLI", "commands": "[\\"dbt deps\\",\\"dbt build\\"]", "profiles": "jaffle_shop:\\n  outputs:\\n    dev:\\n      type: duckdb\\n      path: dbt.duckdb\\n      extensions: \\n        - parquet\\n      fixed_retries: 1\\n      threads: 16\\n      timeout_seconds: 300\\n  target: dev      \\n", "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "containerImage": "ghcr.io/kestra-io/dbt-duckdb:latest"}, {"id": "python", "type": "io.kestra.plugin.scripts.python.Script", "script": "import duckdb\\nimport pandas as pd\\n\\nconn = duckdb.connect(database='dbt.duckdb', read_only=False)\\n\\ntables_query = \\"SELECT table_name FROM information_schema.tables WHERE table_schema = 'main';\\"\\n\\ntables = conn.execute(tables_query).fetchall()\\n\\n# Export each table to CSV, excluding tables that start with 'raw' or\\n'stg'\\n\\nfor table_name in tables:\\n    table_name = table_name[0]\\n    # Skip tables with names starting with 'raw' or 'stg'\\n    if not table_name.startswith('raw') and not table_name.startswith('stg'):\\n        query = f\\"SELECT * FROM {table_name}\\"\\n        df = conn.execute(query).fetchdf()\\n        df.to_csv(f\\"{table_name}.csv\\", index=False)\\n\\nconn.close()\\n", "taskRunner": {"type": "io.kestra.plugin.scripts.runner.docker.Docker"}, "outputFiles": "[\\"*.csv\\"]", "containerImage": "ghcr.io/kestra-io/duckdb:latest"}]}], "source": "id: dwh-and-analytics\\nnamespace: tutorial\\ndescription: Data Warehouse and Analytics\\n\\ntasks:\\n  - id: dbt\\n    type: io.kestra.plugin.core.flow.WorkingDirectory\\n    tasks:\\n      - id: clone_repository\\n     