atecodeID             text,\\n      PULocationID           text,\\n      DOLocationID           text,\\n      passenger_count        integer,\\n      trip_distance          double precision,\\n      fare_amount            double precision,\\n      extra                  double precision,\\n      mta_tax                double precision,\\n      tip_amount             double precision,\\n      tolls_amount           double precision,\\n      ehail_fee              double precision,\\n      improvement_surcharge  double precision,\\n      total_amount           double precision,\\n      payment_type           integer,\\n      trip_type              integer,\\n      congestion_surcharge   double precision\\n  );\\n", "type": "io.kestra.plugin.jdbc.postgresql.Queries"}, {"id": "green_copy_in_to_staging_table", "from": "{{render(vars.data)}}", "type": "io.kestra.plugin.jdbc.postgresql.CopyIn", "table": "{{render(vars.staging_table)}}", "format": "CSV", "header": "true", "columns": "[\\"VendorID\\",\\"lpep_pickup_datetime\\",\\"lpep_dropoff_datetime\\",\\"passenger_count\\",\\"trip_distance\\",\\"RatecodeID\\",\\"store_and_fwd_flag\\",\\"trip_type\\",\\"ehail_fee\\",\\"PULocationID\\",\\"DOLocationID\\",\\"payment_type\\",\\"fare_amount\\",\\"extra\\",\\"mta_tax\\",\\"tip_amount\\",\\"tolls_amount\\",\\"improvement_surcharge\\",\\"total_amount\\",\\"congestion_surcharge\\"]"}], "inputs": [{"id": "taxi", "type": "SELECT", "values": ["yellow", "green"], "isRadio": false, "defaults": "yellow", "required": true, "displayName": "Select taxi type", "allowCustomValue": false}, {"id": "year", "type": "SELECT", "values": ["2019", "2020"], "isRadio": false, "defaults": "2019", "required": true, "displayName": "Select year", "allowCustomValue": false}, {"id": "month", "type": "SELECT", "values": ["01", "02", "03", "04", "05", "06", "07", "08", "09", "10", "11", "12"], "isRadio": false, "defaults": "01", "required": true, "displayName": "Select month", "allowCustomValue": false}], "source": "id: postgres_taxi\\nnamespace: zoomcamp\\ndescription: |\\n  The CSV Data used in the course: https://github.com/DataTalksClub/nyc-tlc-data/releases\\n\\ninputs:\\n  - id: taxi\\n    type: SELECT\\n    displayName: Select taxi type\\n    values: [yellow, green]\\n    defaults: yellow\\n\\n  - id: year\\n    type: SELECT\\n    displayName: Select year\\n    values: [\\"2019\\", \\"2020\\"]\\n    defaults: \\"2019\\"\\n\\n  - id: month\\n    type: SELECT\\n    displayName: Select month\\n    values: [\\"01\\", \\"02\\", \\"03\\", \\"04\\", \\"05\\", \\"06\\", \\"07\\", \\"08\\", \\"09\\", \\"10\\", \\"11\\", \\"12\\"]\\n    defaults: \\"01\\"\\n\\nvariables:\\n  file: \\"{{inputs.taxi}}_tripdata_{{inputs.year}}-{{inputs.month}}.csv\\"\\n  staging_table: \\"public.{{inputs.taxi}}_tripdata_staging\\"\\n  table: \\"public.{{inputs.taxi}}_tripdata\\"\\n  data: \\"{{outputs.extract.outputFiles[inputs.taxi ~ '_tripdata_' ~ inputs.year ~ '-' ~ inputs.month ~ '.csv']}}\\"\\n\\ntasks:\\n  - id: set_label\\n    type: io.kestra.plugin.core.execution.Labels\\n    labels:\\n      file: \\"{{render(vars.file)}}\\"\\n      taxi: \\"{{inputs.taxi}}\\"\\n\\n  - id: extract\\n    type: io.kestra.plugin.scripts.shell.Commands\\n    outputFiles:\\n      - \\"*.csv\\"\\n    taskRunner:\\n      type: io.kestra.plugin.core.runner.Process\\n    commands:\\n      - wget -qO- https://github.com/DataTalksClub/nyc-tlc-data/releases/download/{{inputs.taxi}}/{{render(vars.file)}}.gz | gunzip > {{render(vars.file)}}\\n\\n  - id: green_create_table\\n    type: io.kestra.plugin.jdbc.postgresql.Queries\\n    sql: |\\n      DROP TABLE IF EXISTS {{render(vars.staging_table)}};\\n      CREATE TABLE {{render(vars.table)}} (\\n          unique_row_id          text,\\n          filename               text,\\n          VendorID               text,\\n          lpep_pickup_datetime   timestamp,\\n          lpep_dropoff_datetime  timestamp,\\n          passenger_count        text,\\n          trip_distance          double precision,\\n          RatecodeID             text,\\n          store_and_fwd_flag     text,\\n          PULocationID           text,\\n          DOLocationID           text,\\n          payment_type           integer,\\n          fare_amount            double precision,\\n          extra                  double precision,\\n          mta_tax                double precision,\\n          tip_amount             double precision,\\n          tolls_amount           double precision,\\n          improvement_surcharge  double precision,\\n          total_amount           double precision,\\n          congestion_surcharge   double precision\\n      );\\n  - id: green_create_staging_table\\n    type: io.kestra.plugin.jdbc.postgresql.Queries\\n    sql: |\\n        DROP TABLE IF EXISTS {{render(vars.staging_table)}};\\n        CREATE TABLE IF NOT EXISTS {{render(vars.staging_table)}} (\\n              unique_row_id          text,\\n              filename               text,\\n              VendorID               text,\\n              lpep_pickup_datetime   timestamp,\\n              lpep_dropoff_datetime  timestamp,\\n              store_and_fwd_flag     text,\\n              RatecodeID             text,\\n              PULocationID           text,\\n              DOLocationID           text,\\n              passenger_count        integer,\\n              trip_distance          double precision,\\n              fare_amount            double precision,\\n              extra                  double precision,\\n              mta_tax                double precision,\\n              tip_amount             double precision,\\n              tolls_amount           double precision,\\n              ehail_fee              double precision,\\n              improvement_surcharge  double precision,\\n              total_amount           double precision,\\n              payment_type           integer,\\n              trip_type              integer,\\n              congestion_surcharge   double precision\\n          );\\n  - id: green_copy_in_to_staging_table\\n    type: io.kestra.plugin.jdbc.postgresql.CopyIn\\n    format: CSV\\n    from: \\"{{render(vars.data)}}\\"\\n    table: \\"{{render(vars.staging_table)}}\\"\\n    header: true\\n    columns: [VendorID,lpep_pickup_datetime,lpep_dropoff_datetime,passenger_count,trip_distance,RatecodeID,store_and_fwd_flag,trip_type,ehail_fee,PULocationID,DOLocationID,payment_type,fare_amount,extra,mta_tax,tip_amount,tolls_amount,improvement_surcharge,total_amount,congestion_surcharge]\\npluginDefaults:\\n  - type: io.kestra.plugin.jdbc.postgresql\\n    values:\\n      \\n      url: jdbc:postgresql://192.168.178.21:5432/postgres-zoomcamp\\n      username: kestra\\n      password: k3str4\\n\\n\\n      ", "deleted": false, "disabled": false, "revision": 9, "namespace": "zoomcamp", "variables": {"data": "{{outputs.extract.outputFiles[inputs.taxi ~ '_tripdata_' ~ inputs.year ~ '-' ~ inputs.month ~ '.csv']}}", "file": "{{inputs.taxi}}_tripdata_{{inputs.year}}-{{inputs.month}}.csv", "table": "public.{{inputs.taxi}}_tripdata", "staging_table": "public.{{inputs.taxi}}_tripdata_staging"}, "description": "The CSV Data used in the course: https://github.com/DataTalksClub/nyc-tlc-data/releases\\n", "pluginDefaults": [{"type": "io.kestra.plugin.jdbc.postgresql", "forced": false, "values": {"url": "jdbc:postgresql://192.168.178.21:5432/postgres-zoomcamp", "password": "k3str4", "username": "kestra"}}]}	2025-05-16 13:13:46.72366+00	f	f	f	f	t	\N
